var title_f39_34_40491="Perioperative anaphylaxis vs general";
var content_f39_34_40491=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F51806&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F51806&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Differences between perioperative/perianesthesia anaphylaxis and anaphylaxis in other settings",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Other settings",
"       </td>",
"       <td class=\"subtitle1\">",
"        Perioperative",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Skin",
"       </td>",
"       <td>",
"        Flushing, itching, or urticaria are present in &gt;90 percent of cases",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Signs and symptoms are more likely to be absent",
"         </li>",
"         <li>",
"          Patient cannot report itching",
"         </li>",
"         <li>",
"          May be present but hidden by surgical drapes",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Upper respiratory tract",
"       </td>",
"       <td>",
"        Laryngeal edema can present as throat tightness, deepening of voice",
"       </td>",
"       <td>",
"        Severe laryngeal edema may present as difficulty with intubation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"4\">",
"        Lower respiratory tract",
"       </td>",
"       <td rowspan=\"4\">",
"        Shortness of breath, wheezing, persistent cough are typical",
"       </td>",
"       <td class=\"sublist1_start\">",
"        May present as sudden:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        - Increase in ventilatory pressure needed to inflate lungs",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        - Increase in end-tidal CO",
"        <sub>",
"         2",
"        </sub>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        - Decrease in arterial oxygen saturation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cardiovascular system",
"       </td>",
"       <td>",
"        Dizziness or tunnel vision may signal onset of hypotension (collapse without warning symptoms is not typical)",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Cardiovascular collapse is the first detected manifestation in one-half of cases",
"         </li>",
"         <li>",
"          Arrhythmias and cardiac arrest more common",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
