" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Risk classification for exercise training: class B: presence of known, stable cardiovascular disease with low risk for complications with vigorous exercise, but slightly greater than for apparently healthy individuals",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        This classification includes individuals with any of the following diagnoses:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1. Coronary artery disease (myocardial infarction, bypass surgery, angioplasty, angina pectoris, abnormal exercise test, and abnormal coronary angiograms) whose condition is stable and who have the clinical characteristics outlined below.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2. Valvular heart disease, excluding severe valvular stenosis or regurgitation with the clinical characteristics as outlined below.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3. Congenital heart disease; risk stratification for patients with congenital heart disease should be guided by the 36th Bethesda Conference recommendations.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        4. Cardiomyopathy: ejection fraction &le;30 percent; includes stable patients with heart failure with clinical characteristics as outlined below but not hypertrophic cardiomyopathy or recent myocarditis.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\">",
"        5. Exercise test abnormalities that do not meet any of the high risk criteria outlined in class C below.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Clinical characteristics (must include all of the following)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1. New York Heart Association class 1 or 2.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2. Exercise capacity &le;6 METs.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3. No evidence of heart failure.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\">",
"        4. No evidence of myocardial ischemia or angina at rest or on the exercise test at or below 6 METs.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        5. Appropriate rise in systolic blood pressure during exercise.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        6. Absence of sustained or nonsustained ventricular tachycardia at rest or with exercise.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        7. Ability to satisfactorily self-monitor intensity of activity.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Activity guidelines:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1. Activity should be individualized, with exercise prescription provided by qualified individuals and approved by primary healthcare provider.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Supervision required:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1. Medical supervision during initial prescription session is beneficial.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2. Supervision by appropriate trained nonmedical personnel for other exercise sessions should occur until the individual understands how to monitor his or her activity.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3. Medical personnel should be trained and certified in Advanced Cardiac Life Support. Nonmedical personnel should be trained and certified in Basic Life Support (which includes cardiopulmonary resuscitation).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        ECG and blood pressure monitoring:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1. Useful during the early prescription phase of training, usually 6 to 12 sessions.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
